import React from "react";
import { Switch, Route } from "react-router-dom";

import Playlist from "./Playlist";
import Home from "./Home";

function Routes() {
  return (
    <Switch>
      <Route path="/" exact component={Home} />
    </Switch>
  );
}

export default Routes;
